		function countDown(dateElement, daysElement, hoursElement, minutesElement, secondsElement, prizeAmountElement) {
			var dateValue = dateElement.dataset.date;

			var amountValue = prizeAmountElement.dataset.amount;
			var rateValue = prizeAmountElement.dataset.rate;

			if(!dateValue || !amountValue || !rateValue) return;

			var sdt = new Date(dateValue);
			var dateNow = new Date();

			var diff = sdt.getTime() - dateNow.getTime();

			if(diff < 0) {
				daysElement.textContent = '00D';
				hoursElement.textContent = '00H';
				minutesElement.textContent = '00M';
				secondsElement.textContent = '00S';
			} else {
				var difdt = new Date(diff);

				daysElement.textContent = ('0' + Math.floor(diff / (1000 * 60 * 60 * 24))).slice(-2)+'D';
				hoursElement.textContent = ('0' + Math.floor((diff % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60))).slice(-2)+'H';
				minutesElement.textContent = ('0' + Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60))).slice(-2)+'M';
				secondsElement.textContent = ('0' + Math.floor((diff % (1000 * 60)) / 1000)).slice(-2)+'S';
			}

			amountValue = parseFloat(amountValue) || 0;
			rateValue = parseFloat(rateValue) || 0;

			if(amountValue - rateValue < 0) {
				amountValue = 0;
			} else {
				amountValue = amountValue - rateValue;
			}
			prizeAmountElement.dataset.amount = amountValue.toFixed(3);
			prizeAmountElement.textContent = amountValue.toFixed(3).replace(/\B(?=(\d{3})+(?!\d))/g, ",");

		}

		var dateElement = document.getElementById('payout-duration-value');
		var daysElement = document.getElementById('days');
		var hoursElement = document.getElementById('hours');
		var minutesElement = document.getElementById('minutes');
		var secondsElement = document.getElementById('seconds');

		var prizeAmountElement = document.getElementById('prize-amount-value');

		if (dateElement && daysElement && hoursElement && minutesElement && secondsElement && prizeAmountElement) {
			setInterval(function() {
				countDown(dateElement, daysElement, hoursElement, minutesElement, secondsElement, prizeAmountElement);
			}, 100);
		}
		//
